import React from 'react';
import styled from 'styled-components';

export default function Navbar() {
	return (
		<NavWrapper>
			<div className='nav-bran'>TechBuddy</div>
		</NavWrapper>
	);
}

const NavWrapper = styled.nav`
	width: 100%;
	margin: 0;
	background: transparent;
	padding: 2rem;
	color: #fff;
	font-size: 2rem;
	font-family: 'Poppins';
	display: flex;

	.nav-bran {
		margin: 0 auto;
		text-shadow: 0px 8px 4px rgba(0, 0, 0, 1);
	}
`;
